// Funkcja filtrowania listy szlakÃ³w
function filterList(query) {
  const list = document.getElementById('list');
  const items = list.querySelectorAll('.item');
  const normalizedQuery = query.toLowerCase().trim();
  
  let hasVisibleItems = false;
  
  items.forEach(item => {
    const nameElement = item.querySelector('.name');
    if (nameElement) {
      const itemName = nameElement.textContent.toLowerCase();
      const matches = !normalizedQuery || itemName.includes(normalizedQuery);
      
      item.style.display = matches ? 'flex' : 'none';
      if (matches) {
        hasVisibleItems = true;
      }
    }
  });
  
  // PokaÅ¼/ukryj komunikat o braku wynikÃ³w
  showNoResultsMessage(!hasVisibleItems && normalizedQuery);
}

// Funkcja przybliÅ¼ania do pierwszego znalezionego elementu
function zoomToFirstResult(query) {
  const list = document.getElementById('list');
  const items = list.querySelectorAll('.item');
  const normalizedQuery = query.toLowerCase().trim();
  
  for (const item of items) {
    const nameElement = item.querySelector('.name');
    if (nameElement) {
      const itemName = nameElement.textContent.toLowerCase();
      if (itemName.includes(normalizedQuery)) {
        // Symuluj klikniÄ™cie na pierwszy znaleziony element
        item.click();
        break;
      }
    }
  }
}

